import { View, Text, TouchableOpacity } from 'react-native'
import styles from "./style";

export default function AuthMenu() {

    return (
        <View style={styles.container}>
            <Text style={styles.headerText}>
                Log in
            </Text>

            <TouchableOpacity style>
                <Text> Use Email</Text>
            </TouchableOpacity>
        </View>
    )
}
